const SneakersCard = (props) => {
    const {id,name,brand,description,price,imageUrl}=props;
    return (
        <>
        <section className="sneakers">
            name: {name}
            brand: {brand}
            
        </section>
        </>
      );
}
 
export default SneakersCard;
